import React from "react";
import useStyles from "./styles";
import {
  Avatar,
  Button,
  Paper,
  Grid,
  Typography,
  Container,
  TextField,
} from "@mui/material";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";

const Auth = () => {
  const classes = useStyles();
  const isSignedUp = false;
  const handleSubmit = () => {};

  const handleChange = () => {};
  return (
    <Container component="main" maxWidth="xs">
      <Paper className={classes.paper} elevation={3}>
        <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography variant="h5">{isSignedUp ? "Login" : "Sign in"}</Typography>
        <form className={classes.form} onSubmit={handleSubmit}>
          <Grid container spacing={2}>
            {isSignedUp ? (
              <>
                <Grid>
                  <TextField
                    name="firstName"
                    label="First Name"
                    onChange={handleChange}
                    autoFocus
                    xs={6}
                  />
                </Grid>

                <TextField
                  name="firstName"
                  label="First Name"
                  onChange={handleChange}
                  autoFocus
                  xs={6}
                />
              </>
            ) : (
              <></>
            )}
          </Grid>
        </form>
      </Paper>
    </Container>
  );
};

export default Auth;
